import React from "react";
import NavbarItems from "./Navbar";
import UserTable from "../Tables/UserTable";
import ProductTable from "../Tables/ProductTable";
import OrderTable from "../Tables/OrderTable";

function Dashboard() {
  return (
    <div>
      <NavbarItems />
      <UserTable />
      <ProductTable />
      <OrderTable />
    </div>
  );
}
export default Dashboard;
